import React, { useState, useEffect } from "react";
import axios from "axios";

const API_URL = "http://localhost:5000"; // adjust if needed
const daysOfWeek = ["Sun", "Mon", "Tue", "Wed", "Thu", "Fri", "Sat"];

function Calendar() {
  const [date, setDate] = useState(new Date());
  const [selectedDate, setSelectedDate] = useState(null);
  const [bookedDates, setBookedDates] = useState([]);

  const year = date.getFullYear();
  const month = date.getMonth();

  const firstDay = new Date(year, month, 1).getDay();
  const daysInMonth = new Date(year, month + 1, 0).getDate();

  const calendarDays = [];
  for (let i = 0; i < firstDay; i++) calendarDays.push(null);
  for (let d = 1; d <= daysInMonth; d++) calendarDays.push(d);

  const handlePrevMonth = () => setDate(new Date(year, month - 1));
  const handleNextMonth = () => setDate(new Date(year, month + 1));

  const fetchBookings = async () => {
    try {
      const res = await axios.get(`${API_URL}/bookings`);
      // Normalize to YYYY-MM-DD
      const booked = res.data.map((b) =>
        new Date(b.date).toISOString().split("T")[0]
      );
      setBookedDates(booked);
    } catch (err) {
      console.error("Failed to fetch bookings:", err);
    }
  };

  useEffect(() => {
    fetchBookings();
  }, [date]);

  const formatDate = (day) =>
    new Date(year, month, day).toISOString().split("T")[0];

  return (
    <div className="max-w-md mx-auto p-6 bg-white shadow rounded">
      <div className="flex items-center justify-between mb-4">
        <button onClick={handlePrevMonth} className="text-indigo-600 font-bold">
          &lt; Prev
        </button>
        <h2 className="text-xl font-semibold text-gray-700">
          {date.toLocaleString("default", { month: "long" })} {year}
        </h2>
        <button onClick={handleNextMonth} className="text-indigo-600 font-bold">
          Next &gt;
        </button>
      </div>

      <div className="grid grid-cols-7 gap-1 text-center mb-2">
        {daysOfWeek.map((day) => (
          <div key={day} className="font-medium text-gray-600">
            {day}
          </div>
        ))}
      </div>

      <div className="grid grid-cols-7 gap-1">
        {calendarDays.map((day, idx) => {
          const today = new Date();
          const isToday =
            day === today.getDate() &&
            month === today.getMonth() &&
            year === today.getFullYear();

          const thisDateStr = day ? formatDate(day) : "";
          const isBooked = bookedDates.includes(thisDateStr);
          const isSelected = selectedDate === thisDateStr;

          return (
            <button
              key={idx}
              disabled={!day}
              onClick={() => setSelectedDate(thisDateStr)}
              className={`h-10 rounded ${
                !day ? "" : "hover:bg-indigo-100"
              } ${isToday ? "border border-indigo-400" : ""} ${
                isBooked ? "bg-red-300 text-white" : ""
              } ${isSelected ? "bg-indigo-600 text-white" : ""}
                ${!day ? "cursor-default" : "cursor-pointer"}
              `}
              title={isBooked ? "Already Booked" : "Available"}
            >
              {day || ""}
            </button>
          );
        })}
      </div>

      {selectedDate && (
        <div className="mt-4 p-4 bg-indigo-50 rounded text-indigo-700">
          Selected: <strong>{selectedDate}</strong>
          {bookedDates.includes(selectedDate) ? (
            <div className="text-red-600 font-semibold">Already booked</div>
          ) : (
            <form
              className="mt-2 flex flex-col gap-2"
              onSubmit={async (e) => {
                e.preventDefault();
                const name = e.target.name.value;
                try {
                  await axios.post(`${API_URL}/bookings`, {
                    name,
                    date: selectedDate,
                  });
                  alert("Booking confirmed!");
                  fetchBookings();
                } catch (err) {
                  alert("Failed to book.");
                }
              }}
            >
              <input
                name="name"
                required
                placeholder="Your Name"
                className="border rounded px-2 py-1"
              />
              <button
                type="submit"
                className="bg-indigo-600 text-white px-3 py-1 rounded hover:bg-indigo-700"
              >
                Book Date
              </button>
            </form>
          )}
        </div>
      )}
    </div>
  );
}

export default Calendar;
